import axios from 'axios'
import { API } from '../Constants'

export function CheckAuth(name, password) {
  return axios({
    headers: {
      'x-api-key': 'JKe0EgSzqk74ZlO1NvPAgasTUrkvMY3A9GhVQmAh',
    },
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password,
    },
  })
}

export function Rsvp(rsvp, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'rsvp',
    headers: {
      authorization: auth,
      'x-api-key': 'JKe0EgSzqk74ZlO1NvPAgasTUrkvMY3A9GhVQmAh',
    },
    data: rsvp,
  })
}

export function GetList(auth) {
  return axios({
    method: 'GET',
    baseURL: API + 'getinvites',
    headers: {
      authorization: auth,
      'x-api-key': 'JKe0EgSzqk74ZlO1NvPAgasTUrkvMY3A9GhVQmAh',
    },
  })
}

export function AddInvite(invite, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'addinvite',
    headers: {
      authorization: auth,
      'x-api-key': 'JKe0EgSzqk74ZlO1NvPAgasTUrkvMY3A9GhVQmAh',
    },
    data: {
      "name":invite,
    },
  })
}

export function AddBlog(blog, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'addblog',
    headers: {
      authorization: auth,
      'x-api-key': 'JKe0EgSzqk74ZlO1NvPAgasTUrkvMY3A9GhVQmAh',
    },
    data: blog,
  })
}

export function UpdateBlog(blog, auth) {
  return axios({
    method: 'POST',
    baseURL: API + 'updateblog',
    headers: {
      authorization: auth,
      'x-api-key': 'JKe0EgSzqk74ZlO1NvPAgasTUrkvMY3A9GhVQmAh',
    },
    data: blog,
  })
}
